import React from "react";
import styled from "styled-components";

const StyledBox = styled.div`
  width: 100px;
  height: 100px;
  padding: 10px;
  background-color: red;
  color: black;
  border-radius: 5px;
`;

const Box = () => {
  return <StyledBox onClick={() => console.log("hi")}></StyledBox>;
};

export default Box;
